import { useState } from 'react';
import {NavBar} from './components/index'
function App() {
  const[Route,SetRoute]=useState('Home');
  const{themeColor}=useLibraryContext()
  return (
    <div className="App" style={themeColor}>
      <NavBar Route={Route} setState={SetRoute}/>
    </div>
  );
}

export default App;
